&lt;p&gt;Jingles and his brother were rescued as pups from a high kill shelter.  He&#039;s a little shy at first but warms up and is friendly and affectionate.  He would really like a home.&lt;/p&gt;
&lt;p&gt;Neutered, current on vaccs, heartworm prevention. Est. DOB 1/1/9, 75 lbs.&lt;br /&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;
