&lt;p&gt; &lt;/p&gt;

&lt;p&gt;KAMI is a real sweet little dog who was dumped at the pound.  She was scheduled to be put down when we rescued her from death row.  She gets along well with other dogs and loves people.  She is a beautiful dog with a very kind spirit.&lt;/p&gt;
&lt;p&gt;Kami is spayed, current on vaccs and heartworm prevention.  Est. DOB 2/14/09.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Visit our &lt;a href=&quot;http://www.dogsrus.org&quot;&gt;Website&lt;/a&gt;&lt;a&gt; for more information about our shelter, adoption policies, and procedures.&lt;/a&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Striker was one of 14 dogs living in an old trailer house that had been vacated when his owner was taken away by social services.  He was never aloud outside and was never socialized.  He isn&#039;t an aggressive dog, but he is a little scared of strangers, although very curious and wanting attention.  Given a little time and TLC he comes around and will sit on your lap!  He was given the name striker because he was bitten by a rattlesnake just days before we were able to catch him.  Striker only weighs about 15 pounds and is fully grown.  Striker has come a long way since he has been at the shelter.  He now longs for love and attention and enjoys being held!&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Visit our &lt;a href=&quot;http://www.dogsrus.org&quot;&gt;Website&lt;/a&gt;&lt;a&gt; for more information about our shelter, adoption policies, and procedures.&lt;/a&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;

Gorgeous blue-eyed boy with lovely coat...sweetheart...gets along with other dogs and very very friendly.
&lt;br&gt;
&lt;br&gt;
We will help with crating and Kong training..free training classes. Robbie is a fun loving boy..a great jogger and loves to go swimming at the lake!!
&lt;br&gt;
&lt;br&gt;
Please contact us today about Robbie!!!

&lt;p&gt;LITTLE MISS is such a sweet and friendly dog despite the rough life she has had already.  She was dumped in the country, has been abused, beat on the head, and shot at.  She has survived it all and is doing well.  She needs a home with lots of TLC to make up for everything she has been through.  Little Miss is a real trooper!  She is strong minded and determined to survive.  She has a heart of gold!  She weighs about 30 pounds and loves to be held and cuddled!  She is really a  precious little dog and her pictures just don&#039;t do her justice.&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;
