&quot;Jo&quot; is a  RR/Lab/Shepherd mix.  Jo was born 4/05 and is spayed, heartworm negative and utd on shots.  She does fine with other dogs and children but probably not suitable for a home with cats.  Jo was rescued as a stray from San Antonio.

&lt;p&gt;BeBe was Batgirl and about to be killed at Town Lake Shelter in Austin. We couldn&#039;t let that happen and personally pulled her as Animals First and Reunion Rescue do not partner with the city of Austin.&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;BeBe went to Spindletop and lived through a year and a half of torture. This place kept the dogs in crates 24/7 filled with their own excrement and urine. BeBe came back to us after the Spindletop raid and she&#039;d literally been driven insane.&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;We have completely detoxed BeBe. She is currently enjoying a raw fed diet and herbal support with Bach flower remedies for her rehabilitation from the treatment at Spindletop.&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;BeBe will need an experienced owner who gets troubled girls. BeBe will never be a dog park dog, but is an excellent and loving companion for a single pet household.&lt;/p&gt;
&lt;p&gt;Please contact doggirl1@earthlink.net for more details about BeBe and the Reunion Rescue No-Kill Refuge.&lt;/p&gt;
&lt;p&gt;All dogs are crate and house-trained, raw fed and holistically treated.&lt;/p&gt;
&lt;p&gt;Visit BeBe on Facebook to read more of her story and see cute photos and videos:&lt;br /&gt;&lt;br /&gt;https://www.facebook.com/pages/For-the-Love-of-Batgirl/179774255405090?fref=ts&lt;/p&gt;

&lt;p&gt;Sweet Amber is another Spindletop survivor from last summer&#039;s raid and seizure. They killed her friend Stella who was also boarded there.&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;Amber is a special soul. She is a loving and wonderful companion. She is funny and squatty with her red satin-teen collar and will lay around all day if you let her. She loves watching tv with you and just being with humans.&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;Amber is super trained, does down, leave it, off and walks wonderfully on lead. She is as charming and quirky as they come and a truly special dog.&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;Amber, like all of the Animals First and Reunion Rescue dogs, is crate and house-trained, raw fed and homeopathically treated. We have a wonderful foster to adopt program and lifetime guarantee for all our dogs.&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;Please contact doggirl1@earthlink.net to arrange a meet and greet with Amber at the Reunion Rescue No-Kill Refuge.&lt;/p&gt;
&lt;p&gt;Visit Amber on Facebook to see more cute photos and videos:&lt;br /&gt;&lt;br /&gt;https://www.facebook.com/pages/Help-Amber-and-Stella-abused-in-Houston/137819022958959?fref=ts&lt;/p&gt;

&lt;p&gt;Hi! My name is LOLA and I was a forgotten dog.... until a nice lady saved me the day I was to be euthanized at the pound. I had a litter of puppies and they&#039;ve all been adopted, but I&#039;m still looking for my forever loving home!&lt;/p&gt;
&lt;p&gt;I am 2 to 3 years old, I&#039;ve been spayed, had all my vaccinations, and I am heartworm NEGATIVE (WOO HOO!!) &lt;/p&gt;
&lt;p&gt;I have a &quot;Love Bug&quot; personality, and I would really love to be the only dog because I have not known much love in my life and I yearn for affection. I am not obnoxious, I don&#039;t dig, I don&#039;t bark, I LOVE hugs and I don&#039;t jump up on people. Everyone loves my tiger stripes and they think I am a very special doggie!&lt;/p&gt;
&lt;p&gt;Won&#039;t you PLEASE give me a chance to show you what a wonderful companion I can be?&lt;/p&gt;
&lt;p&gt;With love and kisses,&lt;/p&gt;
&lt;p&gt;LOLA&lt;/p&gt;
&lt;p&gt;Information on this animal is posted as a courtesy. This animal is NOT part of the&lt;br /&gt;Vision Hills rescue animal population, and is not a Vision Hills foster animal. &lt;br /&gt;Vision Hills makes NO guarantees, and is not responsible for the health and &lt;br /&gt;temperament screening of this animal. If you adopt this animal the contract will &lt;br /&gt;be between you and the person who has the animal, not between you and Vision&lt;br /&gt;Hills. When adopting any animal, be informed and ask questions about the animal&#039;s&lt;br /&gt;health status and behavioral tendencies. Ask for verification of vaccination and &lt;br /&gt;heartworm preventative. Be aware of temperament and ask questions to verify the&lt;br /&gt;animal will be a good fit for you and/or your family. To avoid potentially costly&lt;br /&gt;problems, be an informed adopter and ask your vet about important health and&lt;br /&gt;temperament issues before adopting an animal.&lt;/p&gt;

&lt;p&gt;Peanut is a wonderful dog who came from Alvin Animal Control. Some awful person had named him Feo which means ugly. They must have been shortsighted, because Peanut is absolutely lovely.&lt;/p&gt;
&lt;p&gt;He is a smaller dog and all about the tennis ball. Peanut loves to play fetch and when he&#039;s through, will curl up in his crate for a nap.&lt;/p&gt;
&lt;p&gt;Peanut was abused at Spindletop where he was kept in a crate 24/7 for months on end. Some of the other dogs are still going through rehab to move past this devastatng experience.&lt;/p&gt;
&lt;p&gt;Peanut will need an experienced owner who understands dogs and will continue with his raw diet and herbal support. He is coming along beautifully and would love to find that forever someone.&lt;/p&gt;
&lt;p&gt;No kitties or kiddies for now. Peanut is crate and house-trained and like all Reunion Rescue and Animals First dogs, raw fed and holistically treated.&lt;/p&gt;
&lt;p&gt;Please contact doggirl1@earthlink.net to find out more about Peanut and the Reunion Rescue No-Kill Refuge.&lt;/p&gt;
&lt;p&gt;Please visit Peanut&#039;s Facebook page for more cute photos and videos:&lt;br /&gt;&lt;br /&gt;https://www.facebook.com/pages/Peanuts-Page/452948948111371?fref=ts&lt;/p&gt;

