&lt;p&gt; &lt;/p&gt;
&lt;p&gt;Wiliam is an awesome dog who was tortured in Stockton. Before we got  to him, William was starved nearly to death, thrown on a lit bar-be-que  grill and drug behind a pick up truck. He was then dumped at Stockton  Animal Control, a hell on earth.&lt;/p&gt;
&lt;p&gt;William has learned to trust  humans again and is on his way to Texas where he&#039;ll join Reunion  Rescue&#039;s No Kill Refuge, the only holistic raw feeding rescue sanctuary  in the world.&lt;/p&gt;
&lt;p&gt;Please consider a donation by visiting &lt;a href=&quot;http://www.reunionrescue.com/&quot;&gt;www.reunionrescue.com&lt;/a&gt; and clicking the Paypal link.&lt;/p&gt;
&lt;p&gt;Or, snail mail to: 2718 Long Bow Trail Austin TX 78734 All donations go to William and are tax deductible. &lt;/p&gt;
&lt;p&gt;Everyone will be updated with photos and progress reports about this  beautiful boy as he thrives even more and becomes a full fledged Texas  boy!&lt;/p&gt;
&lt;p&gt;Please visit William&#039;s Facebook page for more cute photos and videos:&lt;br /&gt;&lt;br /&gt;https://www.facebook.com/pages/Williams-Page/174863255994426?fref=ts&lt;/p&gt;
&lt;p&gt;Visit William on Facebook to read more about his story and see cute photos and videos:&lt;br /&gt;&lt;br /&gt;https://www.facebook.com/pages/Williams-Page/174863255994426?fref=ts&lt;/p&gt;

&lt;p&gt;William is a little doll! He loves people. This is amazing, because William came from a terrible situation. He was beaten, starved to the bone, thrown on a lit bar-b-que grill and then drug behind a truck. William was to die at one of the worst shelters in the country, but we got him out in the nick of time.&lt;/p&gt;
&lt;p&gt;He&#039;s thriving on a raw fed diet and really buffed out. He enjoys going on long country walks and training for Frisbee. William loves people more than anything and would rather have a hug session than eat or play!&lt;/p&gt;
&lt;p&gt;Please take a look at William&#039;s Facebook page with daily updates, photos and videos:&lt;/p&gt;
&lt;p&gt;https://www.facebook.com/pages/Williams-Page/174863255994426?fref=ts&lt;/p&gt;

&lt;p&gt;Meet sweet wonderful Ellie Mae! Her story with me began last year when I stopped at a gas station in a bad part of town. She was laying lifeless on the pavement. Truthfully I thought she was dead, but as I got closer her little tail began to flick. She was emaciated, bald, extremely heart-worm positive, shot and hit by a car. She suffered all of that at the hands of humans and she was licking my face as I lifted her into my car. Dogs are amazing creatures!&lt;/p&gt;
&lt;p&gt;After a long recovery, she did not end up needing an amputation on her gun shot leg. Thank goodness! She is now about 2-4 years old, 53 lbs, spayed, utd on shots, well into her slow kill heart-worm treatment, and happy running all day. I have been keeping her at a boarding facility since August and will not be able to keep her there much longer. I have done dog rescue for several years now as an independent, and pay out of pocket. It&#039;s my charity, and the joy in my life! I love bullies!&lt;/p&gt;
&lt;p&gt;Ellie Mae is a wonderful dog with people, any and all. Animals are a different story. She is very animal aggressive and it is not fear based. It is more predatory. I have tried to correct her and train her every way I know how. Since I am unable to keep her at my home safely, I am having to board her, which I can no do much longer.&lt;/p&gt;
&lt;p&gt;Won&#039;t you PLEASE give Ellie Mae a chance to show you what a wonderful companion she can be? YOU WON&#039;T REGRET IT!!  :-)&lt;/p&gt;
&lt;p&gt;Information on this animal is posted as a courtesy. This animal is NOT part of the&lt;br /&gt;Vision Hills rescue animal population, and is not a Vision Hills foster animal. &lt;br /&gt;Vision Hills makes NO guarantees, and is not responsible for the health and &lt;br /&gt;temperament screening of this animal. If you adopt this animal the contract will &lt;br /&gt;be between you and the person who has the animal, not between you and Vision&lt;br /&gt;Hills. When adopting any animal, be informed and ask questions about the animal&#039;s&lt;br /&gt;health status and behavioral tendencies. Ask for verification of vaccination and &lt;br /&gt;heartworm preventative. Be aware of temperament and ask questions to verify the&lt;br /&gt;animal will be a good fit for you and/or your family. To avoid potentially costly&lt;br /&gt;problems, be an informed adopter and ask your vet about important health and&lt;br /&gt;temperament issues before adopting an animal.&lt;br /&gt;&lt;br /&gt;&lt;/p&gt;

Emmy is the Senior lady in the back. She is looking for a soft place to land to spend her final years. She is shy and wont cause any problems. As with all our Seniors, Paws Ranch Rescue will pay medical for the dog, for life! Help a senior today! 

&quot;Blessed is the person who has earned the love of an old dog.&quot;
--Sydney Jeanne Seward

&lt;p&gt; &lt;/p&gt;
&lt;p&gt;Minnie was part of a litter that came to the shelter as pups.  She is a very pretty dog whose mother was a purebred German Shepherd Dog, and we think the dad a Catahoula mix.&lt;/p&gt;
&lt;p&gt;Minnie enjoys the companionship of other dogs, is a little shy, but friendly with people, and has a pleasant personality.  She would like to get out of the shelter environment and into a home with people who have time and interest in making her a valued family member.&lt;/p&gt;
&lt;p&gt;She will need a fenced yard, house training, and basic obedience training as she has been housed in an outdoor shelter environment to date.  She has not been around kids or cats.&lt;/p&gt;
&lt;p&gt;Minnie is spayed and current on vaccinations and heartworm prevention. Est. DOB: 2/12/05&lt;br /&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Visit our &lt;a href=&quot;http://www.dogsrus.org&quot;&gt;Website&lt;/a&gt;&lt;a&gt; for more information about our shelter, adoption policies, and procedures.&lt;/a&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;

Age: 4-5 years&lt;br&gt;
Weight: 9.5 pounds&lt;br&gt;&lt;br&gt;
Shaunessy is a 4-5 year old Cairn Terrier mix.  He is a super sweet boy who came to us from the Austin Animal Center.  Shaunessy had some really bad teeth issues, but after those were fixed, he has gained some weight and is a happy healthy little boy!  Shaunessy has a cute low little grumble that he uses to talk about the TV or the butterfly or a squirrel in the yard or a toy that he likes today.  He has a cute personality and really likes to interact with his people.  Shaunessy gets along with other dogs well, but would do best in an only dog or one other dog home situation.  He currently sleeps in a crate, but would be happiest beside his owner either in the bed or next to the bed overnight.  When you come home from work, he will be waiting for you with a cute little spin and yap Woh-Woooorrrrr!  Shaunessy is a sweet little boy and would be a great addition to your home!&lt;br&gt;&lt;br&gt;Adoption fee is $200.
