Hi everyone!  My name is Grace and I am beautiful white German Shepherd with gray peppered markings on my back.  Everyone thinks I am about six years old, but six must be the new three, because I feel like a puppy!  I am in the best shape of my life and I haven&#039;t had any medical concerns.  I love being active and going on walks, road trips, hiking, and swimming, but I also like being a couch potato and watching my favorite animal planet shows!  If there is an animal of any kind on TV, count me in to watch it right beside you.  I like to be a part of everything that goes on, treated like a very important member of the family.  When I had my own family, I lived in the house, slept on my own special bed, and learned to be a good friend and companion.  I am (of course!) house broken and crate trained, I am an awesome leash walker, and I know a handful of playful tricks (sit, stand, lie down, shake, high-five, and &quot;bang&quot;) that made my family happy.  I am well behaved when left alone during the day and my family didn&#039;t put me my crate during the day while they were at work because I was very good. I love hanging around older kids and adults but tend to be pretty clunky around babies and toddlers.  Sometimes I don’t know my own strength, or how hard my tail flaps back and forth!  It takes me some time to become acquainted with other dogs and I&#039;m a bit anxious in dog park settings. However, I shared my home and family with another dog and we got along great, but I&#039;ve always had a secret wish to be an only dog.   As for cats, well, I&#039;m really not a big fan.  I would really love to find a new family to call my own, I&#039;m loyal and beautiful and happy, and I have a lot of love to share.  Maybe you could be my new forever friend?

Fill out an application today if you feel like I would be a great fit in your home!

&lt;p&gt;Please visit &lt;a href=&quot;&quot;http://www.austingermanshepherdrescue.org&quot;&quot;&gt;Austin German Shepherd Rescue&lt;/a&gt; for more information on this pet!&lt;/p&gt;

Loki is a great, handsome dog with an energetic, high play drive. If you’re looking for a dog to do such advanced canine activities as agility or search &amp; rescue then Loki is the dog for you. Loki loves to play fetch and will wear you out long before he is tired of playing. Loki loves his Kong and his jolly ball and is never far from one of his toys. Loki gets along well with other dogs after proper introductions are made.

Due to his high play drive Loki is recommended for someone who is highly experienced with dogs and additional training is highly recommended for him. For the right person, Loki will be a wonderful companion.

&lt;p&gt;Please visit &lt;a href=&quot;&quot;http://www.austingermanshepherdrescue.org&quot;&quot;&gt;Austin German Shepherd Rescue&lt;/a&gt; for more information on this pet!&lt;/p&gt;

&lt;p&gt;Max is a Lab mix boy who was found dumped in the country with his littermates when they were pups.  He&#039;s grown up in an outdoor shelter/kennel environment, but he has a nice, gentle personality and should be able to integrate into a family home if someone is willing to work with him and give him a chance.&lt;/p&gt;
&lt;p&gt;Max is a little bow legged in the back but his vet said it isn&#039;t a problem, and doesn&#039;t appear to cause pain.  Max enjoys other dogs and likes to play with his roommate Bonnie, an older Lab mix.  So far, Max has loved everyone he&#039;s ever met.&lt;/p&gt;
&lt;p&gt;Max is neutered and current on vaccinations and heartworm prevention. Est. DOB 6/1/05.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;
