&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;
&lt;p&gt;Hi!  I am Twinkie.  I was adopted as a puppy and returned a year later when I  grew bigger than my owners anticipated.  Nobody really knows what breed I am but  I am a beautiful brindle and have a soft, shiny coat.&lt;/p&gt;
&lt;p&gt;I get along well with other dogs.  I love to lay on the floor and have my belly rubbed!  I love people but am very protective of my  domain and will alert when strangers approach.&lt;/p&gt;
&lt;p&gt;Twinkie is housetrained, spayed, and current on vaccinations and heartworm prevention.  Est. DOB: 5/22/04&lt;br /&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Visit our &lt;a href=&quot;http://www.dogsrus.org&quot;&gt;Website&lt;/a&gt;&lt;a&gt; for more information about our shelter, adoption policies, and procedures.&lt;/a&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;
&lt;p&gt;Angel is a very sweet, pretty golden/red coated girl.  She is a little shy not having been exposed to much outside of her shelter upbringing, but she warms up quickly and has a nice, easy-going, friendly temperament.&lt;/p&gt;
&lt;p&gt;She really seems to love her sister and roommate, Hailey, and would enjoy a home with another doggy companion.  Angel is a darling girl just waiting for that kind-hearted person to come along and make her a part of a home and family.&lt;/p&gt;
&lt;p&gt;She has not grown up around kids, so we recommend only homes with older, dog-friendly kids.  She may be okay with cats, but again, we&#039;ve only seen her around other dogs, which she loves. :)&lt;/p&gt;
&lt;p&gt;Angel is ready to learn about living life as a family, house-pet, and in return, you will have a sweet Angel to watch over you.&lt;/p&gt;
&lt;p&gt;Angel is spayed and current on vaccinations and heartworm prevention.  Dad was a purebred GSD.&lt;br /&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Visit our &lt;a href=&quot;http://www.dogsrus.org&quot;&gt;Website&lt;/a&gt;&lt;a&gt; for more information about our shelter, adoption policies, and procedures.&lt;/a&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;

&lt;p&gt; &lt;/p&gt;
&lt;p&gt;Briana came to the shelter as a puppy with her siblings, many of whom still reside at the shelter.  This litter was really sick when they came to the shelter and it took months to get them healthy and ready to go to their new homes.  By this time, they had not been socialized or exposed beyond their &quot;sheltered&quot; life.  While several of Briana’s siblings are shy, but curious about meeting new people, Briana is exceptionally shy and unsure.&lt;/p&gt;
&lt;p&gt;She loves and trusts her caretaker, but she has &quot;special needs&quot; that she will require a special home with a patient adult(s) willing to work with her and slowly expose her to new things.  She is shy by nature and not used to all the activity and stimulus of the big, outside world she has never known.&lt;/p&gt;
&lt;p&gt;Briana relies on and seeks comfort in her sister and roommate, Krystal.  Briana is a beautiful girl whose father is a purebred German Shepherd.  She is good with other dogs but has never been around cats or children.&lt;/p&gt;
&lt;p&gt;Briana will prefer a quieter type of household without a lot of traffic, and a small circle of friends.  She needs a home with someone experienced with dog behavior who understands, accepts, and honors her limitations.  A patient person with a soft tone and touch, who doesn&#039;t expect a lot out of her, but wants an easy companion to hang out with at home, will be the best match for bringing out all Briana can offer.  She would probably be easy to crate train and find comfort in a crate as being her safe place.&lt;/p&gt;
&lt;p&gt;Briana is spayed and current on vaccinations and heartworm prevention. Est. DOB: 10/10/05.&lt;br /&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to:&lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Visit our &lt;a href=&quot;http://www.dogsrus.org&quot;&gt;Website&lt;/a&gt;&lt;a&gt; for more information about our shelter, adoption policies, and procedures.&lt;/a&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Lily is a sweet little house dog who absolutely loves and adores people!  She is good with children too.  She loves to have her tummy rubbed, sleep on the bed with you, and curl up on the couch to watch TV.&lt;/p&gt;
&lt;p&gt;She loves playing with other dogs; however, she tends to be a dominate alpha female and can sometimes play very rough so her time spent with other dogs would have to be very closely supervised.  She would do better in a home where she was the only pet and could have all the love and attention!&lt;/p&gt;
&lt;p&gt;Lily is spayed and current on vaccinations and heartworm prevention.  Est. DOB: 6/19/04&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;.&lt;/p&gt;
&lt;p&gt;Visit our &lt;a href=&quot;http://www.dogsrus.org&quot;&gt;Website&lt;/a&gt;&lt;a&gt; for more information about our shelter, adoption policies, and procedures.&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Peanut is a pretty black and tan Doberman mix who enjoys spending time with her sister, Pumpkin, and talking in her special way with her people friends.  Peanut is a quiet, mostly laid back kind of dog.&lt;/p&gt;
&lt;p&gt;Peanut and her sister &lt;a href=&quot;http://www.petfinder.com/petnote/displaypet.cgi?petid=7430541&quot;&gt; Pumpkin &lt;/a&gt;, were turned into the vet&#039;s office to be euthanized when they were just youngsters because they had gotten pregnant when their owners did not spay them nor want them anymore.&lt;/p&gt;
&lt;p&gt;No telling what their life was like back then, but it must not have been &quot;all that,&quot; as they don&#039;t like to talk about it!  Peanut is very sweet and trusting with her caretaker, but quite shy about new things and people.&lt;/p&gt;
&lt;p&gt;Peanut is a sweet dog who would like to have a real loving, forever home with a family of her own, something she&#039;s never had.  But, she likes a small circle of friends and will need a quiet, low-traffic, adults-only home.  A patient, kind-hearted person(s) willing to go slow and provide encouragement to build her self-esteem, confidence, and trust will bring out the best in Peanut. Est. DOB 3/25/06&lt;/p&gt;
&lt;p&gt;Peanut is spayed and current on her vaccinations and heartworm prevention.&lt;br /&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Visit our &lt;a href=&quot;http://www.dogsrus.org&quot;&gt;Website&lt;/a&gt;&lt;a&gt; for more information about our shelter, adoption policies, and procedures.&lt;/a&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Pumpkin is such a pretty girl with her deep, rich, tri-colored coat and beautiful round, expressive &quot;Beagle&quot; looking eyes.  We think Pumpkin is a Doberman mixed possibly with some type of hound?  Pumpkin is a quiet, mostly laid back kind of dog.&lt;/p&gt;
&lt;p&gt;Pumpkin and her sister &lt;a href=&quot;http://www.petfinder.com/petnote/displaypet.cgi?petid=7430536&quot;&gt; Peanut &lt;/a&gt;, were turned into the vet&#039;s office to be euthanized when they were just youngsters because they had gotten pregnant when their owners did not spay them nor want them anymore.&lt;/p&gt;
&lt;p&gt;No telling what their life was like back then, but it must not have been &quot;all that,&quot; and Pumpkin doesn&#039;t like to talk about it!  Pumpkin is very shy and nervous about new things and people.&lt;/p&gt;
&lt;p&gt;Pumpkin is very sweet and trusting with her caretaker, but she retreats to the safety of her dog house when visitors approach.  This pretty girl would like to have a real loving, forever home with a family of her own, something she&#039;s never had.  But, she likes a small circle of friends and will need a quiet, low-traffic, adults-only home.  A special, patient, kind-hearted person(s) willing to go slow and provide encouragement to build her self-esteem, confidence, and trust will bring out the best in Pumpkin.&lt;/p&gt;
&lt;p&gt;Pumpkin is spayed and current on her vaccinations and heartworm prevention.  Pumpkin should be easy to crate-train and will likely find comfort in her crate as being her safe place. Est. DOB 3/25/06&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Visit our &lt;a href=&quot;http://www.dogsrus.org&quot;&gt;Website&lt;/a&gt;&lt;a&gt; for more information about our shelter, adoption policies, and procedures.&lt;/a&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Est. DOB: 1/20/06&lt;/p&gt;
&lt;p&gt;Rowdy was surrendered to the shelter when his owner moved and could not take him.  He was an indoor/outdoor dog, good with other dogs, but had not been around cats.&lt;/p&gt;
&lt;p&gt;Rowdy lives up to his name and has an active, party boy personality.  He&#039;s up for some good adventures, if you are!  Rowdy knows some basic commands such as &quot;sit.&quot;  He is friendly and enjoys playing in the water and being sprayed with the water hose to cool off.&lt;/p&gt;
&lt;p&gt;Rowdy will require an active family who can meet his exercise needs and a secure fenced yard.  We do not know how he is around kids, but given his nature, he might be overwhelming to young children and cats would probably not appreciate him either. .&lt;/p&gt;
&lt;p&gt;Rowdy is neutered and current on vaccinations and heartworm prevention.&lt;/p&gt;
&lt;p&gt;&lt;br /&gt;&lt;strong&gt;Click &lt;a href=&quot;http://www.dogsrus.org/bios.htm&quot;&gt;&lt;em&gt;here&lt;/em&gt;&lt;/a&gt; to complete the adoption questionnaire (link at the top of the page) and email it to: &lt;a href=&quot;mailto:kim@dogsrus.org&quot;&gt;&lt;br /&gt;kim@dogsrus.org&lt;/a&gt;&lt;/strong&gt;&lt;br /&gt;.&lt;/p&gt;
&lt;p&gt;Visit our &lt;a href=&quot;http://www.dogsrus.org&quot;&gt;Website&lt;/a&gt;&lt;a&gt; for more information about our shelter, adoption policies, and procedures.&lt;/a&gt;&lt;/p&gt;
&lt;p&gt; &lt;/p&gt;

&lt;p&gt;Est. DOB 1/25/07&lt;/p&gt;
&lt;p&gt;I am Stanley,and I was born at the vet clinic with my siblings after our Mom (Pumpkin) was dumped there before giving birth.  I have had a rough life, I am a parvo survivor though and very thankful to the shelter for saving my life!   Prior to coming to the shelter, I didn&#039;t have any contact with humans.&lt;/p&gt;
&lt;p&gt;All I know is my caregiver, so I am a little shy when I first meet you.  I really depend on my brother, Indigo, to help lead the way for me.  We love to play together and get along really well with each other.&lt;/p&gt;
&lt;p&gt;If you are willing to work me with, and help me overcome my shyness, I could be a great friend to you.  I&#039;ve never been around kids, though, so they may be too much for me.&lt;/p&gt;
&lt;p&gt;Stanley is neutered and current on vaccinations and heartworm prevention.&lt;/p&gt;

&lt;p&gt; &lt;/p&gt;
&lt;p&gt;LET&#039;s GO INDIGO! Indigo came to the shelter as a puppy with his littermates and mother.  He is a little timid meeting new people, but so anxious, curious, and eager to join in the fun that he seems to warm up pretty quickly.  He likes to talk to people in his special way to get attention and can be quite the character.&lt;/p&gt;
&lt;p&gt;Indigo is an energetic, playful dog who would like a home with another doggy companion.  He&#039;s grown up around other dogs, but since he has grown up in the shelter, he hasn&#039;t had the opportunity to explore all the things the big, outside world has to offer.  Thus, he will require a home willing to work with him and show him the ropes of learning new things, home manners, training, and socializing.&lt;/p&gt;
&lt;p&gt;As you can see from his photo, his dog house is his safe place, but he is right there wanting to come join the action!  Indigo is neutered and current on vaccinations and heartworm prevention. Est. DOB 1/25/07.&lt;/p&gt;
